import axios from "axios";
import BooleanValidation from "../booleanValidation/booleanValidation";
const url = "http://www.omdbapi.com/?apikey=925eba28&s=";
const SearchData = async (movie) => {
  try {
    const requestOptions = {
      headers: {
        "Content-Type": "application/json",
      },
      method: "GET",
      redirect: "follow",
    };
    const response = await axios.get(url + movie, requestOptions);
    !BooleanValidation[response.data.status] &&
      console.error(JSON.stringify(response.data));
    return response.data;
  } catch (error) {
    console.error("Ocorreu " + error + " em " + url);
  }
};

export default SearchData;
